On 1 January 1972, [[Skandinaviska Banken]] and Stockholms Enskilda Bank merged to form [[Skandinaviska Enskilda Banken]], with the aim of creating a bank which could meet the competition from the major international banks. The new bank had 6,730 employees, 393 branches, a well-established customer base and good relationships with many of Sweden's biggest companies.

However, the main reason for the merger was the socialistic economical politics that the, at the time, very left-orientated socialdemocratic party forced on banks and private companies. Only a certain level of profit was allowed, and when Stockholms Enskilda Bank tried to expand, this action was forced back by the Swedish government. Thus the merge with Skandinaviska Banken which created room for an expanding the bank.{{citation needed|date=June 2016}}

At the time of the merger, Skandinaviska Banken was about three times bigger than Stockholms Enskilda Bank and the Wallenberg family was notably divided whether the merger should take place. The plan had originally been initiated by chairman [[Wallenberg family|Marcus Wallenberg (junior)]] whereas the former chairman of the bank, [[Jacob Wallenberg (1892–1980)|Jacob Wallenberg]] was a vocal opponent of the merger. This created some anxiety among the bank staff, and in November 1971, the CEO, [[Marc Wallenberg]] – who was one of the top negotiators of the merger – committed [[suicide]], leaving the Wallenberg family without a natural successor in the banking business.

